import { Route, Routes } from "react-router-dom";

import MovieCard from '../components/movieCard';


function App() {
  // App render
  return (
    <>
      <div id="bgWrap"></div>
      <header>
        <div id="pageTitleContainer">
          <h1 id="pageTitle">cinefile</h1>
        </div>
        <nav id="nav">
          <ul id="navList">
            <li>Login</li>
            <li>Register</li>
          </ul>
        </nav>
      </header>
      <MovieCard userData={userData} />
    </>
  );
}

export default App;
